import React from "react";
import { NavLink } from "react-router-dom";

const Home = () => {

    return(

        <div>

            <NavLink to="./Home">
                <button type="button" class="btn btn-primary btn-lg">Home</button>
            </NavLink>

            <NavLink to="./Patient">
                <button type="button" class="btn btn-primary btn-lg">Patient</button>
            </NavLink>

            <NavLink to="./Clinician">
                <button type="button" class="btn btn-primary btn-lg">Clinician</button>
            </NavLink>                        


<table width="20%" border="0" align="center" cellpadding="0" cellspacing="0">
  <tr>
    <td align="center"> <NavLink to="./Home">
                <button type="button" class="btn btn-primary btn-lg">Home</button>
            </NavLink></td>
    <td align="center"><input type="submit" name="Submit3" id="Submit3" value="Sign in" /></td>
    <td align="center"><input type="submit" name="Submit4" id="Submit4" value="Sign in" /></td>
  </tr>
</table>

        </div>

    );

};

export default Home;
